import React from 'react'
import {useNavigate} from 'react-router-dom';


const Home = () => {

  const navigate = useNavigate();
console.log(navigate);

  return (
    <div className='home'>
       <h2>
        Home Page
      </h2>
      <button 
      onClick={()=> naigate}
      className='btn_css'>Go Back</button>
    </div>
  )
}

export default Home
